import React from 'react';
import '../containers/App.css';

const Card = ({ name, price, id, time, month, region }) => {
  const fish_id = id+1
  const time_display = time?time:'常见'
  let month_display = ''
  if (region !== '') 
  	{month_display = <p>Month: {month?month:'常见'} </p>}

  return (
    <div className='container'>
    <div class="row justify-content-center">
      <img alt='fish' src={`https://acnhapi.com/v1/images/fish/${fish_id}?size=200x200`} />
      <div id="card">
        <h4>{name}</h4>
        <p>Price: {price}</p>
        <p>Time: {time_display}</p>
        {month_display}
      </div>
      </div>
    </div>
  );
}

export default Card;
